import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';  // Ensure this is imported
import Navbar from './components/Layout/Navbar';
import Login from './components/Auth/Login';
import Signup from './components/Auth/Signup';
import CarList from './components/Cars/CarList';
import CarDetail from './components/Cars/CarDetail';
import CarForm from './components/Cars/CarForm';


function App() {
  return (
    <Router>
      {/* Wrap your entire app in the AuthProvider */}
      <AuthProvider>
        <Navbar />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          {/* <Route path="/" element={<ProtectedRoute><CarList /></ProtectedRoute>} /> */}
          <Route path="/cars/new" element={<ProtectedRoute><CarForm /></ProtectedRoute>} />
          <Route path="/cars/:id" element={<ProtectedRoute><CarDetail /></ProtectedRoute>} />
          <Route path="/cars/:id/edit" element={<ProtectedRoute><CarForm /></ProtectedRoute>} />
        </Routes>
      </AuthProvider>
    </Router>
  );
}

export default App;
